怪虫首个商业化产品——堒®，是世界首款基于视觉定位的光伏组件自主清洁机器人，自问世以来，以其安全、多场景、经济、智能、便利、清洁效果好、提升电量显著而著称，被誉为未来光伏清洁的先行者。现已在40多个国家获得广泛赞誉。


怪虫是光伏清洁质量的“倡导者”，是为光伏清洁而生设备堒®的“发明者”，是“可持续光伏清洁”这把财富钥匙的“发现者”。


